style.css:
@-moz-document url-prefix("https://golang.org/"), url-prefix("https://blog.golang.org/") {
body {
    background: #282828;
    color: #ebdbb2;
}
pre, h2, #sidebar {
    background: #353535;
}
h1, h2, h3, h4, table th {
    color: #fe8019;
}
a {
    color: #d79921;
}
a:visited {
    color: #d65d0e;
}
.Header-menuItem, .Header-menuItem a:link, .Footer-links, .Footer-links a:link, #nav a {
    color: #b8bb26;
}
.Header-menuItem a:visited, .Footer-links a:visited, #nav a:visited {
    color: #98971a;
}
img.Footer-gopher, img.gopher, .Header-banner {
    display: none;
}
}
